from helper_functions import *
import main
import random as r

terms = ['short_term', 'medium_term','long_term']
user = main.sp.current_user()['id']

# Get tracks of all time periods
lastMonth = main.sp.current_user_top_tracks(limit=50, time_range=terms[0])
lastSixMonths = main.sp.current_user_top_tracks(limit=50, time_range=terms[1])
allTime = main.sp.current_user_top_tracks(limit=50, time_range=terms[2])

# Get track lists
lastMonthTracks = lastMonth['items']
lastSixMonthTracks = lastSixMonths['items']
allTimeTracks = allTime['items']

# Get just track URIs
lastSixMonthURIs = []
for _ in range(50):
    lastSixMonthURIs.append(lastSixMonthTracks[_]['uri'])

allTimeURIs = []
for _ in range(50):
    allTimeURIs.append(allTimeTracks[_]['uri'])


upsideDownPlaylistURIs = []
playlistLength = 0

# Add tracks that are in all time periods, meaning user listens
# this song has been in their top 50 songs in the last month,
# six months, and of all time.
for _ in range(50):
    temp_uri = lastMonthTracks[_]['uri']
    if temp_uri in lastSixMonthURIs and temp_uri in allTimeURIs:
        upsideDownPlaylistURIs.append(temp_uri)
        playlistLength += 1

# From there, add  tracks that have been in the top 50 
# of the last month and the last six months
for _ in range(50):
    temp_uri = lastMonthTracks[_]['uri']
    if temp_uri in lastSixMonthURIs and temp_uri not in upsideDownPlaylistURIs:
        upsideDownPlaylistURIs.append(temp_uri)
        playlistLength += 1

# If there is space left, randomize the top tracks added
# from the last month and last six months
lastMonthAndSixMonths = lastMonthTracks + lastSixMonthTracks
print(len(lastMonthAndSixMonths))
while playlistLength < 50:
    temp_uri = lastMonthAndSixMonths[r.randint(0, 50)]['uri']
    if temp_uri not in upsideDownPlaylistURIs:
        upsideDownPlaylistURIs.append(temp_uri)
        playlistLength += 1

# Create and add tracks to the new playlist
main.sp.user_playlist_create(user, "When Vecna is Down Bad for You", public = True, description="Created by @jamildellawar on Instagram.")
newPlaylistId = main.sp.user_playlists(user=main.user_id)['items'][0]['id']
main.sp.playlist_add_items(newPlaylistId, upsideDownPlaylistURIs)
pic_base64 = ""
main.sp.playlist_upload_cover_image(newPlaylistId, pic_base64)

